import axios from 'axios'
import * as Endpoint from './transcriptionsEndpoints'

export default {
  getTranscriptions() {
    return axios.get(Endpoint.GetTranscriptionsEndpoint)
  },
  saveTranscriptions(payload) {
    return axios.post(Endpoint.GetTranscriptionsEndpoint, payload)
  },
}
